import React from "react"
// import ReactDom from "react-dom/client"

export default class Inncre extends React.Component{
    constructor(props){
        super(props)
        this.state={
        source:[]
        }
        // console.log(this.state.source);
        
    }
    componentDidMount(){
       let api= fetch("https://fakestoreapi.com/products").then(x=>(x.json()))
        api.then(x=>{
            this.setState({source:x})
        })        
    } 
    render(){
        console.log(this.state.source);

        this.state.source.map(x=>console.log(x.id))
        
        return(
        
            <div>
                {this.state.source.map(x=>{
                    return (<>
                    <div style={{display:"flex"}}>
                    <h1>{x.id}</h1>
                    <h1>{x.title}</h1>
                    
                    </div>
                    <img src={x.image} alt="appim" style={{height:"150px",width:"150px"}}/>
                    
                    
                    </>
                    
                    )
               }
                )}
            </div>
        )
    } 
}














